PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>

SELECT ?team
WHERE {
    # Step 1: Get the death date of Pavel Vezhinov
    ?pavelVezhinov dbo:deathDate ?deathDate .

    # Step 2: Find a person born on this date who is a SportsManager, SoccerManager, and SoccerPlayer
    ?person dbo:birthDate ?deathDate ;
            rdf:type dbo:SportsManager ;
            rdf:type dbo:SoccerManager ;
            rdf:type dbo:SoccerPlayer .

    # Step 3: Determine the team associated with this person
    ?team dbo:coach ?person .

    # Step 4: Identify a coach who is also a SoccerPlayer, SportsManager, and SoccerManager for a team that includes a player (organization) associated with Džemal Berberović
    ?playerTeam dbo:coach ?coach .
    ?coach rdf:type dbo:SoccerPlayer ;
           rdf:type dbo:SportsManager ;
           rdf:type dbo:SoccerManager .

    # The player must be an organization, sports club, and soccer club associated with Džemal Berberović
    ?playerTeam dbo:team ?organization .
    ?organization foaf:name "Džemal Berberović"@en ;
                   rdf:type dbo:Organisation ;
                   rdf:type dbo:SportsClub ;
                   rdf:type dbo:SoccerClub .

    # Step 5: Find the team of the initially identified person
    FILTER(?team = ?playerTeam)
}
